import React from 'react';
import { Link } from 'react-router-dom';

function HeaderLinks({ setHoverItem, setIsExpanded }) {
  // Navigation links (simplified for demonstration)
  const links = ['Home', 'Products', 'About', 'Contact'];

  return (
    <div className="navbar-nav">
      {links.map(name => (
        <div key={name} className="nav-item" onMouseEnter={() => { setHoverItem(name); setIsExpanded(true); }} onMouseLeave={() => setIsExpanded(false)}>
          <Link to={`/${name.toLowerCase()}`} className="nav-link">{name}</Link>
        </div>
      ))}
    </div>
  );
}

export default HeaderLinks;
